      | 366366 -> { ItemTypeData.id= 366366; name= "Federation Logistics G-I"; published= false; description= "The Logistics dropsuit is outfitted with the latest in integrated diagnostic technology, most of which revolves around maintaining the condition and efficiency of squad mates and their equipment. As such, a soldier equipped with this class of dropsuit becomes a force multiplier, greatly improving the overall effectiveness of the unit.    Gallente military doctrine places a premium on human life, favoring technological solutions that augment or even entirely replace human combatants in a conflict. Unsurprisingly, the Gallente Logistics suit is designed to minimize loss of life on the battlefield. A resilient suit, it features an array of biomechanical sensors to monitor ongoing health, while the copious equipment slots allow it to carry everything needed to effectively render aid to victims.    When deployed, a soldier equipped with a Logistics suit fills a vital tactical role in small unit operations and full-scale warfare, providing both, medical and mechanical support."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
